Information
------------------------------

How It's Made: Sports Collection 
Have you ever wondered how many of the everyday objects we use become the things they are. Watch as How It s Made - Sports reveals the methods and materials of everyday items in a behind-the-scenes look at the manufacturing process of footballs, golf balls, baseball bats and much more! 
This collection of short documentaries explains how 40 different everyday pieces of sports equipment are created and how they developed over time


